import React, { Component } from 'react';
import PropTypes from 'prop-types';
import Page from '../pageComponent/PageComponent';
import Avatar from '../../atoms/avatar';
import styles from './defaultPostLayout.module.scss';

class DefaultPostLayout extends Component {
	constructor(props) {
		super(props);
		this.state = {  }
	}
	render() { 
		return (
			<Page>
				<Page.Header className={styles.dPageHeader}>
					<header>
						<h2 className={styles.blogName}>SpaceH</h2>
					</header>
				</Page.Header>
				<Page.Body className={styles.dPageBody}>
					<main>
						<article>
							<header>
								<div className={styles.mainContainer}>
									<div className={styles.leftContainer}>
											<Avatar image={require('../../assets/pic.jpg')} onClickImage={() => {console.log("avatar clicked")}} size={size}/>
									</div>

									<div className={styles.rightContainer}>
										<div className={styles.titleContainer}>
											<h2>{postTitle}</h2>
										</div>

										<div className={styles.dateContainer}>
											<small>{postDate}</small>
										</div>
									</div>
								</div>
							</header>
							<div className={styles.content}>
								{content}
							</div>
						</article>
					</main>
				</Page.Body>
				<Page.Footer className={styles.dPageFooter}>
					<footer>
							<h2 className={styles.blogName}>SpaceH</h2>
							<div className={styles.footerMainContainer}>

								<div className={styles.footerLeftContainer}>
										<Avatar image={require('../../assets/pic.jpg')} onClickImage={() => {console.log("avatar clicked")}} size={'60px'}/>
								</div>

								<div className={styles.footerRightContainer}>
									<div className={styles.footerTopTextStyle}>
										<p>Personal Blog by Harshit Prajapati</p>
										<p>Blog in progress</p>
									</div>
								</div>

							</div>
					</footer>
				</Page.Footer>
			</Page>
		);
	}
}

DefaultPostLayout.propTypes = {
	postTitle: PropTypes.string,
	postDate: PropTypes.string,
	size: PropTypes.string,
	content: PropTypes.object,
};

DefaultPostLayout.defaultProps = {
	postTitle: 'You shouldn`t be seeing this',
	postDate: '9th April, 1995',
	size: '70px',
	content: {},
};

export default DefaultPostLayout;
